import {
  LOADING_PROFILE
} from '../actions/profile';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case LOADING_PROFILE:
      return{
        ...statePart,
        isFetching: true
      }
    default:
      return statePart;
  }
}
